import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faAngleLeft, faAngleRight} from "@fortawesome/free-solid-svg-icons"
import "./Arrows.css"

function Arrows() {
    return (
        <>



        <button type="button" onClick={()=>Left()} className="btn btn-dark arrow"><FontAwesomeIcon icon={faAngleLeft} /> Previous</button>
        <button type="button" className="btn btn-dark arrow arrow-right" >Next <FontAwesomeIcon icon={faAngleRight} /></button>
        </>
    );
}

export default Arrows;
